import React from "react";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";
const Sobre = () => {

    const navigate = useNavigate()

    function logout() {
        localStorage.removeItem('ProfessorID')
        localStorage.removeItem('tokenadminon')
        navigate('/')
    }

    return (
        <>
            <header className="headerlogin headlc">
                <div className="headerloginc">
                    <span className="logo-span-header"><Link to={'/'}>SIGEN</Link></span>
                    <button className="logout" onClick={logout}>Fazer Logout</button>

                </div>
            </header>
            <div className="maincontainerprof mHeight">
                <div className="sobrecontainer">
                    <center className='centertop'>
                        <h1>SIGEN</h1>

                    </center>
                    <p className="paragraphSobre">A SIGEN é uma aplicação criada 100% por mim, 
                    Samyr Marjoub para apresentação do meu TCC da escola "Centro educacional Álvaro Melo Veira" Que acontecerá dia 01/12/2022. </p>
                </div>
            </div>
        </>

    )
}
export default Sobre
